import React, { Component } from 'react'
import Sign from './Sign';

export default class Signs extends Component {

   makeSigns = (signs) =>{
    return   <div>{ signs} </div>
  }


  render() {
   
    return (
      <div>
       { this.makeSigns(this.props.map.signs?'some':'none')}
      </div>
    )
  }
}
